    "geophysical-processes-mo-2016-inventory-of-landslide-occurrences-shp",nt"isopen":
    false,nt"url": null,nt"notes": "The Missouri Inventory of Landslide Occurrences
    (MILO) is a statewide inventory of landslides and slope failure occurrences. Landslides
    can occur anywhere a hill slope is steep enough to become unstable. Human alterations
    and natural erosional processes can escalate the failure. Initiated for use by emergency
    managers and planners in response to slope failures occurring due to seismic ground
    shaking around Crowley's Ridge, MILO includes both earthquake and non-earthquake
    related landslides statewide.",nt"license_title": null,nt"extras": [{ntt"key":
